import styled from "styled-components"

const LogoStyled = styled.div`
    font-family: 'Roboto', sans-serif;
    font-weight: 700;
    font-size: 24px;  
    margin-left: 20px;`

function Logo () { 
    return (
        <div className="logo">
            <h1>Banco</h1>
        </div>
    )
}

export default Logo
